import './App.css';
import CFitness from './Components/Cards/CFitness';
import CFodd from './Components/Cards/CFood';
import Ctask from './Components/Cards/Ctask';
import CWork from './Components/Cards/CWork';

function App() {
  return (
    <>
    <h1 className='Title'>Goal</h1>
    <Ctask/>
    <CFitness/>
    <CWork/>
    <CFodd/>
    </>
  );
};

export default App;
